Ember.TEMPLATES['auth/signin'] = Ember.Handlebars.compile("{{#if redirected}}\n{{/if}}\n\n<span class=\"mascot\"></span>\n<h3>Hey, we're so glad you're here!</h3>\n<h2>In order to view your repositories, please sign in.</h2>\n\n<p>\n  <a href=\"#\" {{action \"signIn\" target=\"auth\"}}>\n    {{#if auth.signingIn}}\n      Signing in...\n    {{else}}\n      Sign in with GitHub\n    {{/if}}\n  </a>\n</p>\n");

Ember.TEMPLATES['build'] = Ember.Handlebars.compile("{{#if loading}}\n  <span>Loading</span>\n{{else}}\n  <div id=\"new-summary\">\n    <div {{bind-attr class=\":request-kind build.eventType\"}} >\n    </div>\n    <div class=\"right\">\n      <div class=\"build-status\">\n        {{#link-to \"build\" repo build}}#{{build.number}} {{build.state}}{{/link-to}}\n      </div>\n\n      <div class=\"runtime\">\n        {{#if build.isFinished}}ran{{else}}running{{/if}} for {{formatDuration build.duration}}\n      </div>\n\n      <div class=\"finished\">\n        {{formatTime build.finishedAt}}\n      </div>\n\n      {{#if build.tagName}}\n        <div class=\"tags\">\n          {{build.tagName}}\n        </div>\n      {{/if}}\n\n      <div class=\"commit-changes\">\n        <a class=\"commit\" {{bind-attr href=\"urlGithubCommit\"}}>Commit {{formatSha commit.sha}}</a>\n      </div>\n      <div class=\"commit-changes\">\n        {{#if build.pullRequest}}\n          <a class=\"compare\" {{bind-attr href=\"build.commit.compareUrl\"}}>#{{build.pullRequestNumber}}: {{build.pullRequestTitle}}</a>\n        {{else}}\n          {{#if build.commit.compareUrl}}\n            <a class=\"compare\" {{bind-attr href=\"build.commit.compareUrl\"}}>Compare {{shortCompareShas build.commit.compareUrl}}</a>\n          {{/if}}\n        {{/if}}\n      </div>\n    </div>\n\n    <div class=\"mainline\">\n      <div class=\"branch\" {{bind-attr title=\"build.commit.branch\"}}>\n        {{build.commit.branch}}\n      </div>\n\n      <div class=\"subject\">\n      - {{formatMessage build.commit.subject repoBinding=build.repo}}\n      </div>\n    </div>\n\n    <pre class=\"body\">{{formatMessage build.commit.body repoBinding=build.repo pre=true}}</pre>\n\n    <div class=\"footer\">\n      <div class=\"author\">\n        {{#if commit.authorName}}\n          <div class=\"authored\"><img {{bind-attr src=\"urlAuthorGravatarImage\"}}/><div class=\"text\">{{commit.authorName}} authored{{#if commit.authorIsCommitter}} and committed{{/if}}</div></div>\n        {{/if}}\n        {{#unless commit.authorIsCommitter}}\n          {{#if commit.committerName}}\n            <div class=\"committed\"><img {{bind-attr src=\"urlCommitterGravatarImage\"}}/><div class=\"text\">{{commit.committerName}} committed</div></div>\n          {{/if}}\n        {{/unless}}\n      </div>\n    </div>\n  </div>\n\n  {{#unless build.isMatrix}}\n    {{view 'annotations' annotations=build.jobs.firstObject.annotations}}\n  {{/unless}}\n\n  {{#if build.isMatrix}}\n    {{view 'jobs' jobs=build.requiredJobs required=\"true\"}}\n    {{view 'jobs' jobs=build.allowedFailureJobs}}\n  {{else}}\n    {{view 'log' job=build.jobs.firstObject}}\n  {{/if}}\n{{/if}}\n");

Ember.TEMPLATES['builds'] = Ember.Handlebars.compile("{{#if content.isLoaded}}\n  <table id=\"builds\" class=\"list\">\n    <thead>\n      <tr>\n        <th>Build</th>\n        <th>Message</th>\n        <th>\n          Commit\n        </th>\n        <th class=\"committer\">\n          Committer\n        </th>\n        {{#if isPullRequestsList}}\n          <th>\n            PR\n          </th>\n        {{/if}}\n        <th>Duration</th>\n        <th>Finished</th>\n      </tr>\n    </thead>\n\n    <tbody>\n      {{#each build in controller itemController=\"buildsItem\"}}\n        <tr {{bind-attr class=\"build.color\"}}>\n          <td class=\"number\">\n            <span class=\"status\"></span>\n            {{#if build.id}}\n              {{#link-to \"build\" build.repo build}}\n                {{build.number}}\n              {{/link-to}}\n            {{/if}}\n          </td>\n          <td class=\"message\">\n            {{{formatMessage build.commit.message short=\"true\" repoBinding=build.repo}}}\n          </td>\n          <td class=\"commit\">\n            <a {{bind-attr href=\"build.urlGithubCommit\"}}>\n              {{formatCommit build.commit}}\n            </a>\n          </td>\n          <td class=\"committer\">\n            {{build.commit.committerName}}\n          </td>\n          {{#if isPullRequestsList}}\n            <td>\n              <a {{bind-attr href=\"build.urlGithubPullRequest\"}}>\n                #{{build.pullRequestNumber}}\n              </a>\n            </td>\n          {{/if}}\n          <td class=\"duration\" {{bind-attr title=\"build.duration\"}}>\n            {{formatDuration build.duration}}\n          </td>\n          <td class=\"finished_at timeago\" {{bind-attr title=\"build.formattedFinishedAt\"}}>\n            {{formatTime build.finishedAt}}\n          </td>\n        </tr>\n      {{/each}}\n    </tbody>\n  </table>\n  {{#if displayShowMoreButton}}\n    <p>\n      {{view 'show-more-button'}}\n      {{#if isLoading}}\n        <span class=\"loading\"></span>\n      {{/if}}\n    </p>\n  {{/if}}\n{{else}}\n  <div class=\"loading\"><span>Loading</span></div>\n{{/if}}\n");

Ember.TEMPLATES['builds/not_found'] = Ember.Handlebars.compile("There are no builds for this repository.\n");

Ember.TEMPLATES['caches'] = Ember.Handlebars.compile("{{#if length}}\n  <a href=\"#\" {{action \"deleteRepoCache\"}} {{bind-attr class=\"isDeleting:deleting :delete-repo-caches\"}}>\n    Delete all repository caches\n  </a>\n\n  <ul id=\"caches\">\n    {{#each controller itemController=\"cachesByBranch\"}}\n      <li class=\"caches-group\">\n        <span class=\"branch\">Branch: {{branch}}</span>\n\n        <a href=\"#\" {{action \"delete\"}} {{bind-attr class=\"isDeleting:deleting :delete-by-branch :delete\"}}>\n          (delete)\n        </a>\n\n        <ul class=\"caches-list\">\n          {{#each cache in caches itemController=\"cacheItem\"}}\n            <li class=\"cache-info\">\n              <span class=\"label\">Slug:</span> {{cache.slug}},\n              <span class=\"label\">Last modified:</span> {{cache.last_modified}},\n              <span class=\"label\">Size:</span> {{mb cache.size}}MB\n\n              <a href=\"#\" {{action \"delete\"}} {{bind-attr class=\"isDeleting:deleting :delete-by-slug :delete\"}}>\n                (delete)\n              </a>\n            </li>\n          {{/each}}\n        </ul>\n      </li>\n    {{/each}}\n  </ul>\n{{else}}\n  There are no caches for this repository.\n{{/if}}\n");

