Ember.TEMPLATES['first_sync'] = Ember.Handlebars.compile("<div id=\"first_sync\">\n  {{#if isSyncing}}\n  <img src=\"/images/getting-started/mustache-spinner.gif\" class=\"spinner\" width=\"300\">\n  <p class=\"first-sync-head\">One more thing</p>\n  <p class=\"few-more\">Just a few more seconds as we talk to GitHub to find out which repositories belong to you.</p>\n  <div class=\"sync-row\">\n    <div class=\"sync-column\">\n      <p class=\"align-right\">\n        If you're part of an organization that already has repositories set up on Travis CI, we'll take you to the list once we're done.\n      </p>\n    </div>\n\n    <div class=\"sync-column\">\n      <p>\n        If you're not part of any existing organizations yet, we'll take you to a handy getting started guide to get you off the ground quickly.\n      </p>\n    </div>\n  </div>\n  {{/if}}\n\n  {{#unless isSyncing}}\n  <div class=\"sync-row\">\n      <img src=\"/images/getting-started/mustache-no-spin.png\" class=\"spinner\" width=\"100\">\n      <p class=\"great-news\">Great news!</p>\n      <p>\n        We've successfully synchronized your details from GitHub. We will redirect you to your profile in a few seconds.\n      </p>\n  </div>\n  {{/unless}}\n</div>\n");

Ember.TEMPLATES['getting_started'] = Ember.Handlebars.compile("<div id=\"getting-started\">\n  <h3>Welcome to Travis CI!</h3>\n\n  <h2>Hey, it looks like you're new around here and have yet to set up your first<br>repository on Travis CI. We're here to help you get started, it's easy!</h2>\n\n  <div class=\"getting-started-row\">\n    <div class=\"column\">\n      <img src=\"/images/getting-started/project-switch.png\">\n    </div>\n\n    <div class=\"column-right\">\n      <span class=\"steps\">Step 1: &nbsp; Enabling your projects</span>\n      <p>\n        Start by going to your {{#link-to \"profile\"}}profile{{/link-to}} and enable one of your projects. We've been\n        synchronizing all repositories you have administrative access to. Pick one and flip the switch next to it.\n      </p>\n    </div>\n  </div>\n\n  <div class=\"getting-started-row\">\n    <div class=\"column\">\n      <img src=\"/images/getting-started/first-build.png\">\n    </div>\n\n    <div class=\"column-right\">\n      <span class=\"steps\">Step 2: &nbsp; Adding Travis</span>\n      <p>\n        Once you've enabled one of your projects, add a <a\n        href=\"http://about.travis-ci.org/docs/user/build-configuration/#.travis.yml-file%3A-what-it-is-and-how-it-is-used\"><code>.travis.yml</code></a> to your project, push some code, and we'll start processing your builds. Wait a\n        whee while and reload the page, and your newly setup and built project will show up on the right.\n      </p>\n    </div>\n  </div>\n\n  <div class=\"getting-started-row\">\n    <div class=\"column\">\n      <img src=\"/images/getting-started/build-email.png\">\n    </div>\n\n    <div class=\"column-right\">\n      <span class=\"steps\">Step 3: &nbsp; Wait for your build to finish</span>\n      <p>\n        We'll be sending you an email once the build has finished. Then, it's up to you to do the happy dance.\n      </p>\n    </div>\n  </div>\n\n  <div class=\"getting-started-row\">\n    <span class=\"after-steps steps\">Build Configuration</span>\n    <p>\n      We use sensible defaults for <a href=\"http://about.travis-ci.org/docs/\">most languages</a>, but you can customize\n      both the <a href=\"http://about.travis-ci.org/docs/user/build-configuration/\">build process</a> and the <a\n      href=\"http://about.travis-ci.org/docs/user/build-configuration/\">build\n      environment</a> to fit your project's needs.\n    </p>\n\n    <span class=\"steps\">Notifications</span>\n    <p>\n      You can also configure how you want to be notified of build results. Email is only one channel you can use. We\n      support <a href=\"http://about.travis-ci.org/docs/user/notifications/#Campfire-notification\">Campfire</a>, <a\n      href=\"http://about.travis-ci.org/docs/user/notifications/#HipChat-notification\">HipChat</a>, <a\n      href=\"http://about.travis-ci.org/docs/user/notifications/#Flowdock-notification\">Flowdock</a>, <a\n      href=\"http://about.travis-ci.org/docs/user/notifications/#IRC-notification\">IRC</a>, and <a\n      href=\"http://about.travis-ci.org/docs/user/notifications/#Webhook-notification\">webhooks</a>. To avoid\n      exposing any private credentials, you can shield them from the public using <a\n      href=\"http://about.travis-ci.org/docs/user/build-configuration/#Secure-environment-variables\">encrypted\n      configuration settings</a>.\n    </p>\n\n    <span class=\"steps\">Questions</span>\n    <p>\n      Should you have any questions or issues, have a look at <a href=\"http://about.travis-ci.org/docs/\" location=\"_top\">our\n      documentation</a>, <a href=\"https://github.com/travis-ci/travis-ci/issues/new\" location=\"_top\">open an issue</a> or\n      <a href=\"mailto:support@travis-ci.com\">send us an email</a>.\n    </p>\n  </div>\n</div>\n");

Ember.TEMPLATES['insufficient_oauth_permissions'] = Ember.Handlebars.compile("<div id=\"insufficient-permissions\">\n  <img src=\"/images/travis-crying.png\" class=\"sad-travis\" width=\"150\">\n\n  <p class=\"insufficient-permissions-head\">\n  \tSorry, something went missing.\n  </p>\n\n  <p class=\"insufficient-permissions-more\">\n    It looks like we don't have sufficient privileges for your GitHub account.\n    This can happen for different reasons, most commonly due to an older token\n    stored on our end, or because some of the permissions have been removed\n    from the token. Unfortunately we need those to provide you with the best service.\n    <br/><br/>\n    Luckily, the issue can be easily corrected by going through the login flow\n    once again. Make sure the permissions we ask for are all available.\n    <br/><br/>\n    For more information about the OAuth scopes and what we need them for,\n    <a href=\"http://docs.travis-ci.com/user/github-oauth-scopes/\">check our documentation on this topic</a>.\n  </p>\n\n  <div class=\"insufficient-permissions-row\">\n    {{#if existingUser}}\n    {{/if}}\n  </div>\n</div>\n");

Ember.TEMPLATES['job'] = Ember.Handlebars.compile("{{#if job.isLoaded}}\n  <div {{bind-attr class=\"view.color\"}}>\n    <div id=\"new-summary\">\n      <div class=\"request-kind\">\n        <div {{bind-attr class=\":kind-icon job.build.eventType\"}}>\n        </div>\n      </div>\n      <div class=\"right\">\n        <div class=\"build-status\">\n          {{#link-to \"job\" repo job}}#{{job.number}} {{job.state}}{{/link-to}}\n        </div>\n\n        <div class=\"runtime\">\n           {{#if job.isFinished}}ran{{else}}running{{/if}} for {{formatDuration job.duration}}\n        </div>\n\n        <div class=\"finished\">\n          {{formatTime job.finishedAt}}\n        </div>\n\n        {{#if job.tagName}}\n          <div class=\"tags\">\n            {{job.tagName}}\n          </div>\n        {{/if}}\n\n        <div class=\"commit-changes\">\n          <div class=\"text\"><a class=\"commit\" {{bind-attr href=\"controller.urlGithubCommit\"}}>Commit {{formatSha job.commit.sha}}</a></div>\n        </div>\n        <div class=\"commit-changes\">\n          {{#if job.build.pullRequest}}\n            <div class=\"text\"><a class=\"compare\" {{bind-attr href=\"job.commit.compareUrl\"}}>#{{job.build.pullRequestNumber}}: {{job.build.pullRequestTitle}}</a></div>\n          {{else}}\n            {{#if job.build.commit.compareUrl}}\n              <div class=\"text\"><a class=\"compare\" {{bind-attr href=\"job.commit.compareUrl\"}}>Compare {{shortCompareShas job.build.commit.compareUrl}}</a></div>\n            {{/if}}\n          {{/if}}\n        </div>\n      </div>\n\n      <div class=\"branch\" {{bind-attr title=\"job.commit.branch\"}}>\n        {{job.commit.branch}}\n      </div>\n\n      <div class=\"subject\">\n        - {{formatMessage job.commit.subject repoBinding=job.repo}}\n      </div>\n\n      <pre class=\"body\">{{formatMessage job.commit.body repoBinding=job.repo pre=true}}</pre>\n\n      <div class=\"footer\">\n        <div class=\"author\">\n          {{#if job.commit.authorName}}\n            <div class=\"authored\"><img {{bind-attr src=\"view.urlAuthorGravatarImage\"}}/><div class=\"text\">{{job.commit.authorName}} authored{{#if job.commit.authorIsCommitter}} and committed{{/if}}</div></div>\n          {{/if}}\n          {{#unless job.commit.authorIsCommitter}}\n            {{#if job.commit.committerName}}\n              <div class=\"committed\"><img {{bind-attr src=\"view.urlCommitterGravatarImage\"}}/><div class=\"text\">{{job.commit.committerName}} committed</div></div>\n            {{/if}}\n          {{/unless}}\n        </div>\n      </div>\n    </div>\n\n    {{view 'annotations' annotations=view.annotations}}\n\n    {{view 'log' job=job}}\n  </div>\n{{else}}\n  <div id=\"job\" class=\"loading\">\n    <span>Loading</span>\n  </div>\n{{/if}}\n");

Ember.TEMPLATES['jobs'] = Ember.Handlebars.compile("{{#if view.jobs.length}}\n  <table {{bind-attr id=view.jobTableId}} class=\"list\">\n  {{#if view.required}}\n    <caption>\n      Build Matrix\n    </caption>\n  {{else}}\n    <caption>\n      Allowed Failures\n      <a title=\"What's this?\" class=\"help open-popup\"\n        name=\"help-allowed_failures\" {{action \"openHelpPopup\" target=view}}></a>\n    </caption>\n  {{/if}}\n    <thead>\n      <tr>\n        {{#each key in view.build.configKeys}}\n          <th>{{key}}</th>\n        {{/each}}\n      </tr>\n    </thead>\n    <tbody>\n      {{#each job in view.jobs}}\n        {{#view 'jobs-item' context=job}}\n          <td class=\"number\">\n            <span class=\"status\"></span>\n            {{#if job.id}}\n              {{#if job.repo.slug}}\n                {{#link-to \"job\" repo job}}{{number}}{{/link-to}}\n              {{/if}}\n            {{/if}}\n          </td>\n          <td class=\"duration\" {{bind-attr title=\"startedAt\"}}>\n            {{formatDuration duration}}\n          </td>\n          <td class=\"finished_at timeago\" {{bind-attr title=\"formattedFinishedAt\"}}>\n            {{formatTime finishedAt}}\n          </td>\n          {{#each value in configValues}}\n            <td>{{value}}</td>\n          {{/each}}\n        {{/view}}\n      {{/each}}\n    </tbody>\n  </table>\n\n  {{#unless view.required}}\n    <div id=\"help-allowed_failures\" class=\"popup\">\n      <a href=\"#\" class=\"close\" {{action \"popupClose\" target=view}}></a>\n      <h4></h4>\n      <p>\n        Allowed Failures are items in your build matrix that are allowed to\n        fail without causing the entire build to be shown as failed.\n      </p>\n      <p>\n        You can define allowed failures in the build matrix as follows:\n      </p>\n      <pre>matrix:\n  allow_failures:\n    - rvm: ruby-head</pre>\n      <p>\n        This lets you add in experimental and preparatory builds to test against versions or\n        configurations that you are not ready to officially support.\n      </p>\n    </div>\n  {{/unless}}\n{{/if}}\n");

Ember.TEMPLATES['jobs/log'] = Ember.Handlebars.compile("{{#if view.log.isLoaded}}\n  {{view 'pre' job=view.job log=view.log}}\n{{else}}\n  <div id=\"log\" class=\"loading\">\n    <span>Loading</span>\n  </div>\n{{/if}}\n");

Ember.TEMPLATES['jobs/pre'] = Ember.Handlebars.compile("<div id=\"log-container\">\n  <a href=\"#\" id=\"tail\" {{action \"toggleTailing\" target=view}}>\n    <span class=\"status\"></span>\n\n    <label>\n      {{#if view.job.isFinished}}\n        Scroll to End of Log\n      {{else}}\n        Follow Log\n      {{/if}}\n    </label>\n  </a>\n  <pre id=\"log\" class=\"ansi\"></pre>\n\n  <a href='#' class=\"to-top\" {{action \"toTop\" target=view}}>To Top</a>\n\n  {{#if view.limited}}\n    <p class=\"warning\">\n      This log is too long to be displayed. Please reduce the verbosity of your\n      build or download the <a {{bind-attr href=\"view.plainTextLogUrl\"}}>raw log</a>.\n    </p>\n  {{/if}}\n</div>\n");

Ember.TEMPLATES['layouts/dashboard'] = Ember.Handlebars.compile("<div class=\"wrapper\">\n  <div id=\"top\">\n    <div class=\"row\">\n      <div class=\"small-2 medium-2 columns\" id=\"logo\">\n        <h1>{{#link-to \"main\"}}Home{{/link-to}}</h1>\n      </div>\n      <div class=\"small-4 medium-3 columns\" id=\"nav\">\n        <ul>\n          <li><a href=\"#\">Docs</a></li>\n          <li><a href=\"#\">Blog</a></li>\n        </ul>\n      </div>\n      <!-- <div class=\"small-4 medium-3 columns\" id=\"status\">\n        <div class=\"status-graph\">Status Graph</div>\n      </div> -->\n      <div class=\"small-2 medium-5 columns no-padding\" id=\"user\">\n        <ul>\n          <li>\n            <p>Justine Arreche</p>\n            <img src=\"images/dashboard/gravatar.png\">\n            <ul>\n              <li>Help</li>\n              <li>Sign Out</li>\n            </ul>\n          </li>\n        </ul>\n      </div>\n    </div>\n  </div>\n\n{{yield}}\n\n</div>\n\n<footer>\n  <div class=\"row\">\n    <div class=\"small-6 medium-4 large-4 columns\">\n      <img src=\"/images/dashboard/footer-logo.svg\">\n    </div>\n    <div class=\"small-6 medium-2 large-2 columns\">\n      <h3>&copy;Travis CI, GmbH</h3>\n      <ul>\n        <li>Rigaer Strae 8</li>\n        <li>10247 Berlin, Germany</li>\n      </ul>\n    </div>\n\n    <div class=\"small-6 medium-2 large-2 columns\">\n      <h3>Help</h3>\n      <ul>\n        <li><a href=\"#\">Documentation</a></li>\n        <li><a href=\"#\">Blog</a></li>\n        <li><a href=\"#\">Email</a></li>\n        <li><a href=\"#\">Live Chat</a></li>\n        <li><a href=\"#\">Twitter</a></li>\n      </ul>\n    </div>\n\n    <div class=\"small-6 medium-2 large-2 columns\">\n      <h3>Legal</h3>\n      <ul>\n        <li><a href=\"#\">Imprint</a></li>\n        <li><a href=\"#\">Terms of Service</a></li>\n        <li><a href=\"#\">Privacy Policy</a></li>\n      </ul>\n    </div>\n\n    <div class=\"small-6 medium-2 large-2 columns\">\n      <h3>Travis CI Status</h3>\n      <ul>\n        <li><div class=\"status-circle\">Status:</div>\n            <a href=\"#\">Travis CI Status</a>\n        </li>\n      </ul>\n    </div>\n  </div>\n</footer>\n");

Ember.TEMPLATES['layouts/flash'] = Ember.Handlebars.compile("{{#each flash in controller}}\n  {{#view Travis.FlashItemView flashBinding=\"flash\"}}\n    <p>{{{flash.message}}}</p>\n    <a class=\"close\" {{action \"close\" target=view}}></a>\n  {{/view}}\n{{/each}}\n");

Ember.TEMPLATES['layouts/home'] = Ember.Handlebars.compile("<div id=\"top\">\n  {{render \"top\"}}\n</div>\n\n<div id=\"left\">\n  {{outlet \"left\"}}\n</div>\n\n<div id=\"main\">\n  {{render \"flash\"}}\n  {{yield}}\n</div>\n\n{{#if config.pro}}\n  <div id=\"right\">\n    {{render \"sidebar\"}}\n  </div>\n{{/if}}\n");

Ember.TEMPLATES['layouts/profile'] = Ember.Handlebars.compile("<div id=\"top\">\n  {{render \"top\"}}\n</div>\n\n<div id=\"left\">\n  {{outlet \"left\"}}\n</div>\n\n<div id=\"main\">\n  {{render \"flash\"}}\n  {{yield}}\n</div>\n\n<div id=\"right\">\n  <div id=\"slider\" {{action \"toggle\" target=Travis.slider}}>\n    <div class='icon'></div>&nbsp;\n  </div>\n\n  <div class=\"box\">\n    <h4>Getting started?</h4>\n    <p>\n      Please read our <a href=\"http://docs.travis-ci.com/user/getting-started\">guide</a>.\n      You'll be up and running in no time!\n    </p>\n    <p>\n      You can find detailed docs on our <a href=\"http://docs.travis-ci.com\">documentation</a> site.\n    </p>\n    <p>\n      If you need help <a href=\"http://stackoverflow.com/questions/ask?tags=travis-ci\">ask a question</a> or hop on <a href=\"irc://irc.freenode.net/#travis\">#travis</a> on irc.freenode.net\n    </p>\n  </div>\n</div>\n");

