Ember.TEMPLATES['profile/accounts'] = Ember.Handlebars.compile("<div id=\"search_box\">\n</div>\n\n<ul class=\"tabs\">\n  <li id=\"tab_accounts\" {{bind-attr class=\"view.classAccounts\"}}>\n    <h5><a name=\"accounts\" href=\"\">Accounts</a></h5>\n  </li>\n</ul>\n\n<div class=\"tab\">\n  {{#collection Travis.AccountsListView contentBinding=\"controller\"}}\n    {{#link-to \"account\" view.account class=\"name\"}}{{view.name}}{{/link-to}}\n    <p class=\"summary\">\n      <span class=\"repos_label\">Repositories:</span>\n      <abbr class=\"repos\">{{view.account.reposCount}}</abbr>\n    </p>\n    <div class=\"indicator\"><span></span></div>\n  {{/collection}}\n</div>\n");

Ember.TEMPLATES['profile/loading'] = Ember.Handlebars.compile("<div class=\"loading\"><span>Loading</span></div>\n");

Ember.TEMPLATES['profile/repo'] = Ember.Handlebars.compile("<h1>Settings: {{slug}}</h1>\n\n{{outlet}}\n");

Ember.TEMPLATES['profile/show'] = Ember.Handlebars.compile("<h3>{{view.name}}</h3>\n\n{{#if config.billing_endpoint}}\n  {{#if view.subscribed}}\n    <a class=\"button activated\" {{bind-attr href=\"billingUrl\"}}>\n      Subscription active!\n    </a>\n  {{else}}\n    {{#if view.education}}\n      <a class=\"button activated\" {{bind-attr href=\"billingUrl\"}}>\n        Educational account!\n      </a>\n    {{else}}\n      <a class=\"button activate\" {{bind-attr href=\"billingUrl\"}}>\n        Sign up this account!\n      </a>\n    {{/if}}\n  {{/if}}\n{{/if}}\n\n{{view Travis.ProfileTabsView}}\n\n<div class=\"tab\">\n  {{outlet}}\n</div>\n");

Ember.TEMPLATES['profile/tabs'] = Ember.Handlebars.compile("<ul class=\"tabs\">\n  <li id=\"tab_hooks\" {{bind-attr class=\"view.classHooks\"}}>\n    <h5>\n      {{#link-to \"account\" account}}Repositories{{/link-to}}\n    </h5>\n  </li>\n  {{#if view.displayUser}}\n    <li id=\"tab_user\" {{bind-attr class=\"view.classUser\"}}>\n      <h5>\n        {{#link-to \"accounts.info\"}}Profile{{/link-to}}\n      </h5>\n    </li>\n  {{/if}}\n  {{#if config.billing_endpoint}}\n    <li id=\"tab_billing\" class=\"right\">\n      <h5>\n        <a {{bind-attr href=\"billingUrl\"}}>Billing</a>\n      </h5>\n    </li>\n  {{/if}}\n</ul>\n");

Ember.TEMPLATES['profile/tabs/user'] = Ember.Handlebars.compile("<img {{bind-attr src=\"view.gravatarUrl\"}}>\n\n<dl class=\"profile\">\n  <div>\n    <dt>\n      GitHub\n    </dt>\n    <dd>\n      <a {{bind-attr href=\"urlGithub\"}}>{{user.login}}</a>\n    </dd>\n  </div>\n  <div>\n    <dt>\n      Email\n    </dt>\n    <dd>\n      {{user.email}}\n    </dd>\n  </div>\n  <div>\n    <dt>\n      Token\n    </dt>\n    <dd>\n      {{user.token}}\n    </dd>\n  </div>\n</dl>\n");

Ember.TEMPLATES['queue'] = Ember.Handlebars.compile("<ul id=\"queues\">\n  <li class=\"queue\">\n    <h4>Queue ({{length}})</h4>\n    <ul>\n      {{#if length}}\n        {{#each job in controller}}\n          <li>\n            {{#if job.repo.slug}}\n              {{#link-to \"job\" job.repo job}}\n                <span class=\"slug\" {{bind-attr title=\"job.slug\"}}>\n                  {{job.repo.slug}}\n                </span>\n                #{{job.number}}\n              {{/link-to}}\n            {{/if}}\n          </li>\n        {{/each}}\n      {{else}}\n        There are no jobs\n      {{/if}}\n    </ul>\n  </li>\n</ul>\n");

Ember.TEMPLATES['remove_log'] = Ember.Handlebars.compile("<a href=\"#\" class=\"close\" {{action \"close\" target=view}}></a>\n<p><strong>This action will remove the log permanently!</strong></p>\n<p>Do you want to continue?</p>\n<p>\n  <a class=\"sync_now button\">Yes, please!</a>\n  <span class=\"or\">or</span>\n  <a href=\"#\" class=\"cancel\">Cancel</a>\n</p>\n");

Ember.TEMPLATES['repo'] = Ember.Handlebars.compile("<div id=\"repo\" {{bind-attr class=\"view.className\"}}>\n  {{#if view.isEmpty}}\n    {{view Travis.ReposEmptyView}}\n  {{else}}\n    {{#if repo.isLoaded}}\n      <div id=\"repo-header\">\n        <h3>{{#link-to \"repo\" repo}}{{repo.slug}}{{/link-to}}</h3>\n        <div class=\"github-icon\"><a {{bind-attr href=\"controller.urlGithub\"}}><img src=\"/images/icons/github.svg\" width=\"21\" height=\"21\"/></a></div>\n        <div class=\"status-image\">\n          <a href=\"#\" id=\"status-image-popup\" name=\"status-images\" class=\"open-popup\" {{action \"statusImages\" target=view}}>\n          <img {{bind-attr src=\"view.statusImageUrl\"}} title=\"Build Status Images\"/>\n          </a>\n        </div>\n\n        {{view 'repo-show-tools'}}\n      </div>\n\n      <p class=\"description\">{{description}}</p>\n\n      {{view 'repo-show-tabs'}}\n      {{view 'repo-actions'}}\n\n      <div class=\"tab\">\n        {{outlet}}\n      </div>\n    {{else}}\n      <div class=\"loading\"><span>Loading</span></div>\n    {{/if}}\n  {{/if}}\n</div>\n");

Ember.TEMPLATES['repo/loading'] = Ember.Handlebars.compile("<div class=\"loading\"><span>Loading</span></div>\n");

Ember.TEMPLATES['repos'] = Ember.Handlebars.compile("<div id=\"search_box\">\n  {{input value=controller.search placeholder=\"Search all repositories\"}}\n</div>\n\n{{view 'repos-list-tabs'}}\n\n<div class=\"tab\">\n  {{#if isLoaded}}\n    {{#collection 'repos-list' content=this}}\n      {{#with view.repo as repo}}\n        <div class=\"slug-and-status\">\n          <span class=\"status\"></span>\n          {{#if repo.slug}}\n            {{#link-to \"repo\" repo class=\"slug\"}}{{repo.slug}}{{/link-to}}\n          {{/if}}\n        </div>\n        {{#with repo.lastBuildHash as lastBuild}}\n          {{#if repo.slug}}\n            {{#link-to \"build\" repo lastBuild.id\n            class=\"last_build\"}}{{lastBuild.number}}{{/link-to}}\n          {{/if}}\n        {{/with}}\n\n        {{#if repo.lastBuildHash.number }}\n        <p class=\"summary\">\n          <span class=\"duration_label\">Duration:</span>\n          <abbr class=\"duration\" {{bind-attr title=\"lastBuildStartedAt\"}}>\n            {{formatDuration repo.lastBuildDuration}}\n          </abbr>\n        </p>\n        <p class=\"summary\">\n          <span class=\"finished-icon\"></span><span class=\"finished_at_label\">Finished:</span>\n          <abbr class=\"finished_at timeago\" {{bind-attr title=\"lastBuildFinishedAt\"}}>\n            {{formatTime repo.lastBuildFinishedAt}}\n          </abbr>\n        </p>\n        {{/if}}\n\n        <div class=\"indicator\"><span></span></div>\n      {{/with}}\n    {{else}}\n      <p class=\"empty\">{{noReposMessage}}</p>\n    {{/collection}}\n  {{else}}\n    <div class=\"loading\"><span>Loading</span></div>\n  {{/if}}\n</div>\n");

Ember.TEMPLATES['repos/list/tabs'] = Ember.Handlebars.compile("<ul class=\"tabs\">\n  <li id=\"tab_owned\" {{bind-attr class=\"view.classOwned\"}}>\n    <h5>{{#link-to \"main.repositories\"}}My Repositories{{/link-to}}</h5>\n  </li>\n\n  {{#unless config.pro}}\n    <li id=\"tab_recent\" {{bind-attr class=\"view.classRecent\"}}>\n      <h5>{{#link-to \"main.recent\"}}Recent{{/link-to}}</h5>\n    </li>\n  {{/unless}}\n\n  <li id=\"tab_search\" {{bind-attr class=\"view.classSearch\"}}>\n    <h5>Search</h5>\n  </li>\n\n  <li id=\"tab_new\" {{bind-attr class=\"view.classNew\"}}>\n    <h5>{{#link-to \"profile\" trackEvent=\"add-repository-from-list\" title=\"Add New Repository\"}}+{{/link-to}}</h5>\n  </li>\n</ul>\n");

Ember.TEMPLATES['repos/show/actions'] = Ember.Handlebars.compile("<div id=\"actions\">\n  <ul>\n    {{#if view.displayCancelBuild}}\n      <li class=\"icon cancel-build\" title=\"Cancel Build\">\n        <a href=\"#\" {{action \"cancelBuild\" target=view}}\n          {{bind-attr class=\"view.canCancelBuild::disabled\"}}></a>\n      </li>\n    {{/if}}\n    {{#if view.displayCancelJob}}\n      <li class=\"icon cancel-job\" title=\"Cancel Job\">\n        <a href=\"#\" {{action \"cancelJob\" target=view}}\n          {{bind-attr class=\"view.canCancelJob::disabled\"}}></a>\n      </li>\n    {{/if}}\n    {{#if view.displayRequeueBuild}}\n      <li class=\"icon restart-build\" title=\"Restart Build\">\n        {{#if view.requeueing}}\n          <span class=\"icon loading\"></span>\n        {{else}}\n          <a href=\"#\" {{action \"requeueBuild\" target=view}}\n            {{bind-attr class=\"view.canRequeueBuild::disabled\"}}></a>\n        {{/if}}\n      </li>\n    {{/if}}\n    {{#if view.displayRequeueJob}}\n      <li class=\"icon restart-job\" title=\"Restart Job\">\n        {{#if view.requeueing}}\n          <span class=\"icon loading\"></span>\n        {{else}}\n          <a href=\"#\" {{action \"requeueJob\" target=view}}\n            {{bind-attr class=\"view.canRequeueJob::disabled\"}}></a>\n        {{/if}}\n      </li>\n    {{/if}}\n    {{#if view.jobIdForLog}}\n      {{#if view.showDownloadLog}}\n        <li class=\"icon download-log\" title=\"Download Log\">\n          <a class=\"download-log\" {{bind-attr href=\"view.plainTextLogUrl\"}}></a>\n        </li>\n      {{/if}}\n    {{/if}}\n    {{! the next if is a hack for refreshing displayRemoveLog when we change\n    views, it sometimes doesn't work properly }}\n    {{#if view.jobIdForLog}}\n      {{#if view.displayRemoveLog}}\n        <li class=\"icon remove-log\" title=\"Remove Log\">\n          <a href=\"#\" name=\"remove-log-popup\" class=\"open-popup\" {{action \"removeLogPopup\" target=view}}\n            {{bind-attr class=\"view.canRemoveLog::disabled\"}}></a>\n        </li>\n      {{/if}}\n    {{/if}}\n    {{#if view.displayCodeClimate}}\n      <li class=\"icon code-climate\" title=\"Test Coverage with Code Climate\">\n        <a href=\"#\" name=\"code-climate\"\n          {{action \"codeClimatePopup\" target=view}}\n          {{bind-attr class=\":open-popup\"}}></a>\n      </li>\n    {{/if}}\n\n  </ul>\n</div>\n\n<div id=\"remove-log-popup\" class=\"popup\">\n  <a href=\"#\" class=\"close\" {{action \"popupClose\" target=view}}></a>\n  <p><strong>This action will remove the log permanently!</strong></p>\n  <p>Do you want to continue?</p>\n  <p>\n    <a class=\"sync_now button\" {{action \"removeLog\" target=\"view\"}}>Yes, please!</a>\n    <span class=\"or\">or</span>\n    <a href=\"#\" class=\"cancel\" {{action \"popupClose\" target=view}}>Cancel</a>\n  </p>\n</div>\n");

Ember.TEMPLATES['repos/show/tabs'] = Ember.Handlebars.compile("<ul class=\"tabs\">\n  <li id=\"tab_current\" {{bind-attr class=\"view.classCurrent\"}}>\n    <h5>\n      {{#if repo.slug}}\n        {{#link-to \"repo\" repo current-when=\"repo.index\"}}\n          Current\n        {{/link-to}}\n      {{/if}}\n    </h5>\n  </li>\n  <li id=\"tab_builds\" {{bind-attr class=\"view.classBuilds\"}}>\n    <h5>\n      {{#if repo.slug}}\n        {{#link-to \"builds\" repo}}\n          Build History\n        {{/link-to}}\n      {{/if}}\n    </h5>\n  </li>\n  <li id=\"tab_pull_requests\" {{bind-attr class=\"view.classPullRequests\"}}>\n    <h5>\n      {{#if repo.slug}}\n        {{#link-to \"pullRequests\" repo}}\n          Pull Requests\n        {{/link-to}}\n      {{/if}}\n    </h5>\n  </li>\n  <li id=\"tab_branches\" {{bind-attr class=\"view.classBranches\"}}>\n    <h5>\n      {{#if repo.slug}}\n        {{#link-to \"branches\" repo}}\n          Branch Summary\n        {{/link-to}}\n      {{/if}}\n    </h5>\n  </li>\n  <li id=\"tab_build\" {{bind-attr class=\"view.classBuild\"}}>\n    <h5>\n      {{#if build.id}}\n        {{#if repo.slug}}\n          {{#link-to \"build\" repo build}}\n            Build #{{build.number}}\n          {{/link-to}}\n        {{/if}}\n      {{/if}}\n    </h5>\n  </li>\n  <li id=\"tab_job\" {{bind-attr class=\"view.classJob\"}}>\n    <h5>\n      {{#if job.id}}\n        {{#if repo.slug}}\n          {{#link-to \"job\" repo job}}\n            Job #{{job.number}}\n          {{/link-to}}\n        {{/if}}\n      {{/if}}\n    </h5>\n  </li>\n  <li id=\"tab_settings\" {{bind-attr class=\"view.classSettings\"}}>\n    <h5>\n      {{#if repo.slug}}\n        {{#link-to \"settings\" repo}}\n          Settings\n        {{/link-to}}\n      {{/if}}\n    </h5>\n  </li>\n  <li id=\"tab_requests\" {{bind-attr class=\"view.classRequests\"}}>\n    <h5>\n      {{#if repo.slug}}\n        {{#link-to \"requests\" repo}}\n          Requests\n        {{/link-to}}\n      {{/if}}\n    </h5>\n  </li>\n  {{#if config.caches_enabled}}\n    <li id=\"tab_caches\" {{bind-attr class=\"view.classCaches\"}}>\n      <h5>\n        {{#if repo.slug}}\n          {{#link-to \"caches\" repo}}\n            Caches\n          {{/link-to}}\n        {{/if}}\n      </h5>\n    </li>\n  {{/if}}\n\n  <li id=\"tab_request\" {{bind-attr class=\"view.classRequest\"}}>\n    <h5>\n      {{#if request.id}}\n        {{#if repo.slug}}\n          {{#link-to \"request\" repo request}}\n            Request #{{request.id}}\n          {{/link-to}}\n        {{/if}}\n      {{/if}}\n    </h5>\n  </li>\n</ul>\n");

Ember.TEMPLATES['repos/show/tools'] = Ember.Handlebars.compile("<div id=\"tools\">\n  <a href=\"#\" {{action \"menu\" target=view}} class=\"menu-popup-button\">Settings</a>\n\n  <ul class=\"menu\">\n    {{#if view.displaySettingsLink}}\n      <li>\n        {{#link-to \"settings\" view.repo}}Settings{{/link-to}}\n      </li>\n    {{/if}}\n    <li>\n      {{#link-to \"requests\" view.repo}}Requests{{/link-to}}\n    </li>\n    {{#if config.caches_enabled}}\n      <li>\n        {{#link-to \"caches\" view.repo}}Caches{{/link-to}}\n      </li>\n    {{/if}}\n\n  </ul>\n</div>\n\n<div id=\"regenerate-key\" class=\"popup\">\n  <a href=\"#\" class=\"close\" {{action \"popupClose\" target=view}}></a>\n  <p>\n    Do you really want to regenerate ssl keys for this repository? Please note that\n    any data, which is encrypted, such as notification services credentials or secure\n    environment variables will not be accessible during the builds until you re-encrypt\n    it with the new key.\n  </p>\n\n  <p>\n    <a class=\"sync_now button\" {{action \"regenerateKey\" target=view}}>Yes, do it!</a>\n    <span class=\"or\">or</span>\n    <a href=\"#\" class=\"cancel\" {{action \"popupClose\" target=view}}>Cancel</a>\n  </p>\n</div>\n\n<div id=\"regeneration-success\" class=\"popup\">\n  <a href=\"#\" class=\"close\" {{action \"popupClose\" target=view}}></a>\n  <p>\n    Key for this repository has been regenerated. If you used previous key\n    for encryption, you will need encrypt your data again with the new key.\n  </p>\n\n  <p>\n    You can read more about encryption keys <a href=\"http://about.travis-ci.org/docs/user/encryption-keys/\">in Travis documentation</a>\n  </p>\n</div>\n\n<div id=\"code-climate\" class=\"popup\">\n  <img src=\"/images/icons/code-climate-logo.svg\" id=\"code-climate-logo\"/>\n  <a href=\"#\" class=\"close\" {{action \"popupClose\" target=view}}></a>\n  <p>\n    <b>Want test coverage for your tests?</b>\n  </p>\n  <p>\n    Integrating <a href=\"https://codeclimate.com\">Code Climate's test coverage</a> reporting with your test\n    suite on Travis CI allows to track changes in coverage over time. If you haven't tried it out already, <a\n    {{bind-attr href=config.code_climate_url}}\" target=\"_blank\">sign\n    up today</a> to improve your code's quality. New customers get 20% off for the first three months!\n  </p>\n\n  <p>\n    It only takes a few steps, once you've set up your project:\n  </p>\n\n  <ol>\n    <li>\n      Add the `code-climate-reporter` gem to your Gemfile:<br/>\n\n<pre>\ngem \"codeclimate-test-reporter\", group: :test, require: nil\n</pre>\n    </li>\n    <li>\n      Load the reporter in your `test_helper` or `spec_helper`, putting it at the very top:\n\n<pre>\nrequire \"codeclimate-test-reporter\"\nCodeClimate::TestReporter.start\n</pre>\n    </li>\n    <li>\n      Add the Code Climate token to your .travis.yml:\n\n<pre>\naddons:\n  code_climate:\n    repo_token: adf08323...\n</pre>\n    </li>\n  </ol>\n</div>\n");

Ember.TEMPLATES['request'] = Ember.Handlebars.compile("<div id=\"request\" {{bind-attr class=\"isAccepted:accepted:rejected\"}}>\n  <h3>{{status}}{{#unless isAccepted}}: {{message}}{{/unless}}</h3>\n\n  <p class=\"request-details\">\n    {{#if isPullRequest}}\n      This request is based on the\n      <span class=\"pr-number\" {{bind-attr title=\"pullRequestTitle\"}}>#{{pullRequestNumber}}</span>\n      pull request.\n    {{else}}\n      This request is based on a commit {{formatCommit commit}} by {{commit.authorName}}\n      pushed to\n      {{#if branchName}}\n        to <code>{{branchName}}</code>\n      {{/if}}\n    {{/if}}\n  </p>\n  {{#if build}}\n    <p class=\"request-details\">\n    A build created based on this request: {{#link-to \"build\" build}}#{{build.number}}{{/link-to}}\n    </p>\n  {{/if}}\n</div>\n");

Ember.TEMPLATES['requests'] = Ember.Handlebars.compile("{{#if config.pro}}\n<div class=\"travis-lint\">\n  <p>Travis Lint for clean .yml files\n    <a {{bind-attr href=\"lintUrl\"}}>lint.travis-ci.org/{{repo.slug}}</a>\n  </p>\n</div>\n{{/if}}\n\n<table id=\"requests\" class=\"list\">\n  <thead>\n    <tr>\n      <th>Request</th>\n      <th>Commit</th>\n      <th>Build</th>\n      <th>Commit message</th>\n      <th>Type</th>\n      <th>Message</th>\n    </tr>\n  </thead>\n\n  <tbody>\n    {{#each controller itemController=\"request\"}}\n      <tr {{bind-attr class=\"requestClass\"}}>\n        <td class=\"request-id\">\n          <span class=\"status\"></span>\n          {{id}}\n        </td>\n        <td>{{githubCommitLink repo.slug commit.sha}}</td>\n        <td>\n          {{#if build}}\n            {{#link-to \"build\" build}}#{{build.number}}{{/link-to}}\n          {{else}}\n            -\n          {{/if}}\n        </td>\n        <td class=\"commit-message\">{{{formatMessage commit.message short=\"true\" repoBinding=build.repo}}}</td>\n        <td>{{type}}</td>\n        <td>{{message}}</td>\n      </tr>\n    {{/each}}\n  </tbody>\n</table>\n");

